Apipecto
Apipecto is a system for describing programmatic interfaces in a non-technical, easy-to-understand way. The goal is to know at a glance how the unit is used.
A set of lines describing the unit can be added to the comment to succinctly summarize how a unit is used. Only the public interfaces for a unit are described.
Example
/**
 * The set of files representing an SSL certificate.
 *
 * API:
 * - SSL enabled?
 * - Have certificate?
 * - : encoded text
 * - Request CSR: organization details = encoded text
 * - .
 */
class SslKeychain {
  /** Should the webserver use SSL? */
  public sslEnabled: boolean

  private pemFile: string

  /** Is the certificate installed? */
  public get haveCertificate(): boolean {
    // Check if the certificate file is on disk and matches the
    // private key on disk.
  }

  /** Request a CSR from the internal private key. */
  public requestCsr(details: CertRequest): string {
    // Generate a certificate signing request (CSR) from the
    // provided details of the organization and return the ASCII-
    // armored CSR text for uploading to a certificate authority.
  }

  /**
   * Install a certificate.
   *
   * @return True if certificate was valid and the webserver came
   * up in HTTPS.
   */
  public installCert(certText: string): Promise {
    // Write the certificate to a file, verify that it matches
    // the private key, and write HTTPS setting into webserver config.
  }

  /**
   * Signal the webserver to restart using whatever mode is
   * configured in its config file.
   */
  public restartWebserver(): Promise {
    // ...
  }

  /** Generate a private key of the given size. */
  private generate(size: number): Promise {
    // Eventually return once key is generated and saved to disk.
    // The key is private and its contents are not returned.
  }
}

interfaces.html.body:
Interfaces
Interfaces are either ways that control of execution can flow into a unit or how it can flow out to other units.
Inputs

A unit's inputs either describe:

a property, which is a piece of state data in the unit which is publically accessible, or
a method, which is a goal this unit is capable of achieving on behalf of others.

Both properties and methods are selectors but they contain other information, such as a description of their types or return values, which combined with other information about how they're accessed.
Outputs
A unit's methods may send control of execution out to another unit, which are outputs. Only the first level of the callstack is described.

Each line names the other unit being referenced with the selector being called.
// : ID.
//   - Database: find user by ID.
//   - Fs: remove file.
public deleteUser(id: number): Promise {
  this.database.findUserById(id)
    .then(user => user.delete())
    .then(user => fs.removeFile(user.logFile))
    .then(err => {
      if (err)
        throw err;
      this.log(`User removed.`)
    })
}

selectors.html.body:
Selectors

Selectors are just a set of one or more words, such as "Reset", or "Delete file", or "Create HTTP request".
Both properties and methods are identified by selectors. The selector should match the words used in the property or method name but used spaced words rather than camel-casing.
// Fetch file description: filename = descriptor
public fetchFileDescriptor(filename: string): string

Acronyms can be capitalized when they're not capitalized within the code. 
// Create HTTP request: URI = request
public createHttpRequest(uri: string): HttpRequest

The selector terminates at EOL for properties.
// Property name
public propertyName: string

It terminates at the first punctuation mark for methods (excluding the angle brackets used to represent asynchronous interfaces and curly braces used for lambdas).
// Delete record: ID.
public deleteRecord(id: number): void

// Is record?
public isRecord(): boolean

// Get increment = number
public getIncrement(): number

// .
public disconnect(): Promise

properties.html.body:
Properties

Properties describe the state data held inside the unit that is publically accessible.
// Unite
public unite: string

// Afternoon visit
public afternoonVisit: number

// Visible?
public visible: boolean

Properties are written similar to synchronous terms, except that whereas terms are the incoming or outgoing components of an interface, properties are the interface.
In the rare case that properties are asynchronous or lambdas, they would be described the same way but with the surrounding angle brackets or curly braces.
// 
public macAddress: Promise

// 
public doneUpdating: Promise

// 
public isConnected: Promise

// {present age = minimum age}
public legalAge: { (age: number): number }

procedures.html.body:
Procedures

Procedures are methods returning void. They end with a period, which distinguishes them from properties.
// Tank race.
public tankRace(): void

Boolean parameters are followed by question marks the same as boolean properties.
// Explain truck: neat?.
public explainTruck(neat: boolean): void

Multiple parameters are separated by commas.
// Waste maddening: milky, crown, light.
public wasteMaddening(milky: number, crown: string, light: number): void

Optional parameters are surrounded by square brackets. Optional boolean parameters include the question park inside the brackets.
// Bury crime: trade, [cup].
public buryCrime(trade: Record, cup?: string): void

// Willing bag: [look?].
public willingBag(look?: boolean): void

// Appreciate: handle?, eager.
public appreciate(handle: boolean, eager: number): void

predicates.html.body:
Predicates

Methods that return a boolean. There is no distinction between predicates and boolean properties.
// Lacking?
public lacking(): boolean

The question mark is part of the selector, so unlike the period for procedures, the question mark for predicates goes before the parameter list.
// Turn light?: lumber
public turnLight(lumber: number): boolean

The predicate can have boolean parameters, where the question mark is used for it as well as the selector.
// Texture report?: pan, puzzled?
public textureReport(pan: number, puzzled: boolean): boolean

// Sense room?: trite?, join
public senseRoom(trite: boolean, join: string)

functions.html.body:
Functions

Functions are methods that return a value (or they'd be procedures) that's not boolean (or they'd be predicates). The description of the return value follows an equals sign.
// Offer harm = description
public offerHarm(): string

// Deep rest: queen = details of update
public deepRest(queen: string): RecordUpdate

Optional return values are written similarly to optional parameters.
// Get resource owner = [ID if exists]
public getResourceOwner(): number | void

async-data.html.body:
Async data

Asynchronous data are promises that eventually resolve to the indicated description. These are terms that are usually used as the return value for asynchronous functions.
// Rigid umbrella: sore? = 
public rigidUmbrella(sore: boolean): Promise

They can be used as parameters or properties although that's rare.
// Cause utter: .
public causeUtter(announce: Promise): void

// 
public isNetworkSimulated: Promise

async-procedures.html.body:
Async procedures

Asynchronous procedures are functions that promise to return void. Their selectors are surrounded by angle brackets and end with period outside the brackets. Though they will resolve void, they can still be rejected.
// .
public stingyCloudy(): Promise

// Stingy cloudy.
public stingyCloudySync(): void

// : hurt.
public pretendLace(hurt: number): Promise

// Pretend lace sync: hurt.
public pretendLaceSync(hurt: number): void

async-predicates.html.body:
Async predicates

Asynchronous predicates promise to return a boolean.
// 
public armFretful(): Promise

// Arm fretful sync?
public armFretfulSync(): boolean

When parameters are used with async predicates, the parameters follow the brackets.
// : rapid
public requestSoda(rapid: string): Promise
